import React from 'react';
import styled from "styled-components";

export default function Career(props) {
  const Wrapper = styled.div`
  @import url('https://fonts.googleapis.com/css2?family=Montserrat:wght@300&display=swap');
  
  *{
  margin: 0;
  padding: 0;
  box-sizing: border-box;
  font-family: 'Montserrat', sans-serif;
  font-weight: normal;
  
  
  }
  nav{
        position: fixed;
        background:whitesmoke ;
        width: 100%;
        padding: 10px 0;
        z-index: 12;
        }
        nav .menu{
        max-width: 1250px;
        margin: auto;
        display: flex;
        align-items: center;
        justify-content: space-around center;
        padding: 0 40px;
        }
        .menu .logo a{
        text-decoration: none;
        color: #000048;
        font-size: 35px;
        font-weight: 900;
        }
        .menu ul{
        display: inline-flex;
        }
        .menu ul li{
        list-style: none;
        margin-left: 7px;
        }
        .menu ul li:first-child{
        margin-left: 0px;
        }
        .menu ul li a{
        text-decoration: none;
        color: #000048;
        font-size: 18px;
        font-weight: 900;
        padding: 12px 15px;
        border-radius: 5px;
        transition: all 0.5s ease;
        }
        .menu ul li a:hover{
        background: #000048;
        color: whitesmoke;
        }

       h1{
        display:flex;
        position:absolute;
       } 
  `;

    
return (
      
      <Wrapper>
      {/* <nav>
